class VLANSet(TextualConvention, OctetString):
    description = 'A set of VLAN ids. The octet string represents a bit array where each bit represents a VLAN id. If the bit is set, then the VLAN id is included in the set. VLANs are identified from left to right, where the leftmost bit in octet 1 is VLAN id 0 and the rightmost bit in octet 512 represents VLAN id 4095. (Note that VLAN id 0 and 4095 are invalid VLAN ids and these bits shall always be 0). Example: The VLAN ids 4-8, 15, 16, 23, 42 are represented by the octet string starting with the following octets (in hex): 0f8181000020...'
    status = 'current'
    displayHint = '1x'
    subtypeSpec = OctetString.subtypeSpec + ValueSizeConstraint(512, 512)
    fixedLength = 512

